        <li>Corruption Perception Index, from the <a href="https://www.transparency.org/en/cpi/2023" target="_blank">Transparency International</a>, last updated on 2023 - Corruption Perception Index (CPI) [2023] by Transparency International is licensed under CC-BYND 4.0. View here: https://www.transparency.org/en/cpi/2023.</li>
